package body pixel_package is

-- function returning RGB value of a selected pixel
function BG_getPixelColor(column : natural; row : natural) return std_logic_vector is
begin
    if (row >= 0 and row < 480) and (column >= 0 and column < 640) then
        if BACKGROUND(row, column) = 0 then 
            return "000000000000000000000000";
        elsif BACKGROUND(row, column) = 1 then 
            return "111111111111111111111111";
        end if;
    end if;
    return (others => '0');
end function;
end package body;
